import React from "react";
import Sidebar from "../../compoments/Sidebar";

function User() {
  return (
    <div className="d-flex ">
      <div className="container row ">
        <Sidebar />
        <div className="col">
          <h1>user</h1>
        </div>
      </div>
    </div>
  );
}

export default User;
